import React, { useState } from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import MainContent from './components/MainContent';
import Interface1 from './components/Interface1';
import Interface2 from './components/Interface2';





function App() {
  const [currentPage, setCurrentPage] = useState('Home');

  const handleNavigation = (page) => {
    setCurrentPage(page);
  };

  return (
    <div>
      {currentPage === 'MainContent' && (
        <>
          <Header />
          <MainContent onNavigate={handleNavigation} />
          <Footer />
        </>
      )}

      {currentPage === 'Interface1' && (
        <Interface1 onNavigate={handleNavigation} />
      )}

      {currentPage === 'Interface2' && (
        <Interface2 onNavigate={handleNavigation} />
      )}
    </div>
  );
}

export default App;
